  \"Oceanographic and surface meteorological data collected from station 45165 - Monroe,
  MI by LimnoTech and assembled by Great Lakes Observing System (GLOS) in the Great
  Lakes region from 2014-08-07 to 2015-06-30 (NODC Accession 0123661)\",\n\t\"tracking_summary\":
