  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123661 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). LimnoTech collected the data from their in-situ moored station named 45165
  - Monroe, MI in the Great Lakes. GLOS, which assembles data from LimnoTech and other
  sub-regional coastal and ocean observing systems of the Great Lakes region of the
  United States, submitted the data to NODC as part of NODC's Integrated Ocean Observing
  System Data Assembly Centers (IOOS DACs) Data Stewardship Program. Each month, NODC
  adds to the Accession the data collected during the previous month.\",\n\t\"license_title\":
